import Logo from "../components/Logo";

var style = {
  position: "fixed",
  bottom: "0",
  width: "100%",
  height: "6rem,",
  padding: "1rem", 
  backgroundColor: "#fbfbfb",
  marginTop: "1rem",
  left: "0"
};

const Footer = () => (
  <footer style={style}>
    <div className="container">
      <div className="row">
        <div class="col-sm"><p>Generisk Bank AS</p><p>Gatevegen 42, 5007 Bergen</p><p>Orgnnr: 999 999 999</p></div>
        <div class="col-sm"><Logo/></div>
        <div class="col-sm"></div>
      </div>
    </div>
  </footer>
);

export default Footer;
